import React from 'react'
import { Card, Image, Row, Col } from 'react-bootstrap'
import skillsData from '../../assets/skillsData.json'

const SkillsCard = () => {

   const DeploymentSkills = skillsData.filter(item=> item.category=== 'Deployment')

    return(
        <Card >

            <Card.Body >
                <Card.Title>
                    Deployment
                </Card.Title>
                <Card.Subtitle>
                    Services
                </Card.Subtitle>
                    {DeploymentSkills.map(item=>
                    <div style={styles.itemRow} key={item.id}>
                        <p>test test test</p>
                        <div style={styles.itemStack} >
                            <Image src={require('../../assets/images/Icons'+ item.iconLogo)} style={styles.logo}/> 
                            <p>{item.name}</p>
                        </div>
                      </div>
                      )}

            </Card.Body>

        </Card>
    )

}

const styles = {

    itemRow: {
        display: 'flex',
        flexDirection: 'row'
    },
    itemStack: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center'
    },
    logo: {
        height: '4em',
        width: '4em',
        color: 'white',
        margin: '0.4em'   
    }
}

export default SkillsCard;
